import React from "react";
import "./Checkout.css";

export default function Checkout({ cartItems, setCartItems }) {
  return cartItems.map((item) => {
    return (
      <>
        <div className="topMargin"></div>
        <div className="itemCard">{item.id}</div>
      </>
    );
  });
}
